import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';

@Component({
  selector: 'app-doctor-interface',
  templateUrl: './doctor-interface.component.html',
  styleUrls: ['./doctor-interface.component.css']
})
export class DoctorInterfaceComponent {

  username: string = '';
  // Add other prescription details as needed

  constructor(private http: HttpClient) {}

  submitPrescription() {
    const prescriptionData = {
      username: this.username,
      // Add other prescription details as needed
    };

    this.http.post('http://localhost:3000/api/prescriptions', prescriptionData)
      .subscribe((response: any) => {
        console.log(response);
        // Handle success
      }, (error) => {
        console.error(error);
        // Handle error
      });
  }
}
